('2351','18','7877','Felder Santa Ponsa',Null,'Elegante Villa mit 2 Wohnungen in Santa Ponsa zu verkaufen','33124','Die Villa steht auf einem 1.138m² großen, flachen Grundstück in ruhiger Wohnlage in Nova Santa Ponsa. Nur wenige Fahrminuten entfernt von mehreren Golfplätzen, Jachthäfen mit schicken Restaurants und v.m. 2002 wurde diese Villa mit hochwertigen Materialien erstellt und bietet auf 2 Wohnetagen je ein Apartment. Das EG bietet auf 194m² Wohnfläche ein Wohn-Esszimmer mit offener Einbauküche, 2 große Schlafzimmer mit je einem Badezimmer en suite, Gäste WC und überdachte Terrassen.    Im 1. OG verteilen sich auf 122m² ein Wohn-Esszimmer, 2 Schlafzimmer, 2 Badezimmer ein Gäste WC und ein 18m² großer Balkon. Im Kellergeschoß hat es noch einen Multiraum mit Oberlichtfenster für Kinoraum, Fitness oder Spa Bereich. Zur Ausstattung gehören eine Klimaanlage w/k, Alu Doppelglasfenster, Alufensterläden und 2 Einbauküchen sowie Möblierung. Im Außenbereich besticht ein sehr schön angelegter und automatisch bewässerter, mediterraner Garten mit einem 5x10m großen Pool. Ein Garagenplatz und 3 Stellplätze runden das Angebot ab','33125','1600000','106','2015-07-15 12:43:41','106','2015-07-15 12:44:18',Null,'2427','121','1014',1,'1','0',Null,Null,Null,'33126',Null,'0','0','0',Null,'2015-07-15 13:47:06',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33127',Null,'33128',Null,'33129',Null,'33130','Willi von Minkner','33131','0',0,'5');
